import { useState, useEffect } from "react";
import React from "react";
import Usefetch from "./useFetch";
import {
  Typography,
  Table,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  TableBody,
} from "@mui/material";
import { StyledTableCell } from "../components/StyledTableComponents";

function Profile({ auth }) {
  const { data, loading, error } = Usefetch(
    "https://retoolapi.dev/GFHqAV/getemployees"
  );
  console.log(
    "data",
    data?.map((val, index) => {})
  );
  return (
    <div>
      Hello User!
      {/* <h1>{data?.map((val,index)=><li key={index}>{val.name} {val.company}</li>)}</h1> */}
      {/*  */}
      {/* <div>{data.map((val)=>{val.})}</div> */}
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead style={{ background: "green" }}>
            <TableRow>
              <StyledTableCell
                style={{ minWidth: "20%", fontWeight: 600, color: "white" }}
                align="center"
              >
                Name
              </StyledTableCell>
              <StyledTableCell
                style={{ minWidth: "20%", fontWeight: 600, color: "white" }}
                align="center"
              >
                Company Name
              </StyledTableCell>
              <StyledTableCell
                style={{ minWidth: "20%", fontWeight: 600, color: "white" }}
                align="center"
              >
                Designation
              </StyledTableCell>
              <StyledTableCell
                style={{ minWidth: "20%", fontWeight: 600, color: "white" }}
                align="center"
              >
                Logo
              </StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data?.map((val, index) => (
              <TableRow key={index}>
                <StyledTableCell>{val?.name}</StyledTableCell>
                <StyledTableCell>{val?.company}</StyledTableCell>
                <StyledTableCell>{val?.designation}</StyledTableCell>
                <img src={val?.designation} style={height=60,width=60}/>


              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}

export default Profile;
